import './Card.css';
import React from 'react';

function Card(props) {
  return (
    <div className="Card">
      <button type="button" onClick={() => props.handleDelete(props.listId, props.id)}>delete</button>
      <h3>{props.title}</h3>
      <p>{props.content}</p>
    </div>
  );
}

export default Card;
